; /* Start:"a:4:{s:4:"full";s:48:"/local/templates/webit/js/menu.js?15906501353693";s:6:"source";s:33:"/local/templates/webit/js/menu.js";s:3:"min";s:0:"";s:3:"map";s:0:"";}"*/
jQuery(function($){

    if (window.innerWidth < 768) {
        var $elements = $('#nav .cf .hd');
        var $selected = $elements.filter('.selected');

        var $subElements = $elements.find('.subn li');
        var $subElementSelected = $elements.find('.selected');

        $elements.hover(function (event, element) {
            $elements.removeClass('selected');
        }, function(event, element) {
            $selected.addClass('selected');
        });
        $subElements.hover(function (event, element) {
            $subElementSelected.removeClass('selected');
        }, function(event, element) {
            $subElementSelected.addClass('selected');
        });

        $('#nav .cf .hd .item--ic').on('click', function(event, element) {
            if (window.innerWidth <= 1023) {
                $(this).parents('.hd').find('.subn').css({opacity: 1, visibility: 'visible', pointerEvents: 'auto', zIndex: 2000});
                event.preventDefault();
                $('body').addClass('menu3level');
            }
        });

        $('.link-back').on('click', function (event, element) {
            $(this).parents('.subn').css({'opacity': 0, visibility: 'hidden', pointerEvents: 'none', zIndex: 2000});
            event.preventDefault();
            $('body').removeClass('menu3level');
        });
    }

    // $(window).on('resize', function (event) {
    //     if (window.innerWidth > 1023) {
    //         $elements.find('.subn').attr('style', '');
    //     }
    // });

    $('.open_nav_btn').on('click', function(event){
        $elements.find('.subn').attr('style', '');
    });

    if (window.matchMedia("(min-width: 767px)").matches) {
        $('#nav > ul li').hover(function () {
            clearTimeout($.data(this,'timer'));
            $('.drop',this).stop(true,true).slideDown(300);
        }, function () {
            $.data(this,'timer', setTimeout($.proxy(function() {
                $('.drop',this).stop(true,true).slideUp(300);
            }, this), 100));
        });
        if($(".header__bot-nav-item").hasClass('sub')){
          $('.header__bot-nav-item').hover(function () {
              clearTimeout($.data(this,'timer'));
              $('.header__bot-submenu',this).stop(true,true).slideDown(200);
           }, function () {
             $.data(this,'timer', setTimeout($.proxy(function() {
               $('.header__bot-submenu',this).stop(true,true).slideUp(200);
             }, this), 100));
           });
        }
        if($(".header__bot-submenu-item").hasClass('sub')){
          $('.header__bot-submenu-item').hover(function () {
              clearTimeout($.data(this,'timer'));
              $('.header__submenu-third',this).stop(true,true).slideDown(200);
           }, function () {
             $.data(this,'timer', setTimeout($.proxy(function() {
               $('.header__submenu-third',this).stop(true,true).slideUp(200);
             }, this), 100));
           });
        }
        
    }
    $('#m-menu').on('click', function(e){
      e.preventDefault();
      $('.header__m-menu-sub').toggleClass('active');
      $('.header__menu-icon').toggleClass('open');
    });
    $('.header__m-show-menu').on('click', function(e){
      e.preventDefault();
      $('.header__m-submenu').not($(this).siblings('.header__m-submenu')).hide("slow");
      $('.header__m-show-menu').not($(this)).removeClass('open');
      $(this).toggleClass('open');
      $(this).siblings('.header__m-submenu').slideToggle("slow");
    });
    $('.header__m-submenu-btn').on('click',function(e){
      e.preventDefault();
      $(this).toggleClass('open');
      $('.m-submenu__third').slideToggle();
    })
        
});
/* End */
