function initLevelMenu() {
	if ($('.header-frame').length) {
		$('body').addClass('three-level');
	} else {
		$('body').addClass('two-level');
	}
	if ($('#bx-panel').length) {
		$('body')
			.removeClass('three-level')
			.removeClass('two-level')
			.addClass('admin-mode');
	}
}

function menuBehavior() {
	var currentScrollTop = 0;
	var adminMode = $('#bx-panel').length > 0;
	if (!adminMode) {
		var bottom = $(window).scrollTop();
		$(window).scroll(function() {
			scrollTop = $(this).scrollTop();
			if (scrollTop == 0) {
				$('body').removeClass('scrolling-down');
				$('body').removeClass('scrolling-up');
			} else if (scrollTop > currentScrollTop && $(window).scrollTop() > 40) {
				// downscroll code
				$('body').addClass('scrolling-down');
				$('body').removeClass('scrolling-up');
			} else {
				// upscroll code
				if (scrollTop - bottom > 750 || bottom - scrollTop > 750) {
					console.log('=================== MENU =================');
					bottom = $(window).scrollTop();
					$('body').addClass('scrolling-up');
					$('body').removeClass('scrolling-down');
				}
			}
			currentScrollTop = scrollTop;
		});
	}
}

//  cookie   name,  ,  ,  undefined
function getCookie(name) {
	var matches = document.cookie.match(
		new RegExp('(?:^|; )' + name.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g, '\\$1') + '=([^;]*)')
	);
	return matches ? decodeURIComponent(matches[1]) : undefined;
}

