//  php  nubmer_format
function number_format(number, decimals, dec_point, thousands_sep) {
	// Format a number with grouped thousands
	var i, j, kw, kd, km;
	if (isNaN((decimals = Math.abs(decimals)))) {
		decimals = 2;
	}
	if (dec_point == undefined) {
		dec_point = ',';
	}
	if (thousands_sep == undefined) {
		thousands_sep = '.';
	}
	i = parseInt((number = (+number || 0).toFixed(decimals))) + '';
	if ((j = i.length) > 3) {
		j = j % 3;
	} else {
		j = 0;
	}
	km = j ? i.substr(0, j) + thousands_sep : '';
	kw = i.substr(j).replace(/(\d{3})(?=\d)/g, '$1' + thousands_sep);
	kd = decimals
		? dec_point +
		  Math.abs(number - i)
				.toFixed(decimals)
				.replace(/-/, 0)
				.slice(2)
		: '';

	return km + kw + kd;
}

function calculate() {
	var calculator = $('#target_calc');
	var clicks = $(calculator)
		.find('input.amount')
		.val();
	var result = 0;
	var am_val = 0;
	var vk_val = 0;
	var od_val = 0;
	var fb_val = 0;
	var inst_val = 0;

	var am = $(calculator)
		.find('#check-field1200')
		.is(':checked');
	var vk = $(calculator)
		.find('#check-field1201')
		.is(':checked');
	var od = $(calculator)
		.find('#check-field1202')
		.is(':checked');
	var fb = $(calculator)
		.find('#check-field1203')
		.is(':checked');
	var inst = $(calculator)
		.find('#check-field1204')
		.is(':checked');
	if (clicks == '4000+') {
		$(calculator)
			.find('.calc-total-title span')
			.html('&nbsp;');
		$(calculator)
			.find('.calc-total-result span')
			.html('   ')
			.addClass('calculate_individual');
	} else {
		var countSocials = 0;
		var resultSocials = 0;
		if (am) {
			am_val = 10000;
		}
		if (vk) {
			vk_val = 30;
			countSocials++;
		}
		if (od) {
			od_val = 30;
			countSocials++;
		}
		if (fb) {
			fb_val = 50;
			countSocials++;
		}
		if (inst) {
			inst_val = 50;
			countSocials++;
		}
		if (countSocials == 0) {
			resultSocials = 0;
		} else {
			resultSocials = (vk_val + od_val + fb_val + inst_val) / countSocials;
		}

		$(calculator)
			.find('.calc-total-title span')
			.html('  ');
		result = clicks * resultSocials + am_val;
		result = number_format(result, 0, '.', ' ');

		$(calculator)
			.find('.calc-total-result span')
			.html(result + ' ')
			.removeClass('calculate_individual');
	}
}

