function calculate_programmatic() {
	var calculator = $('#programmatic_calc');
	var budget = $(calculator)
		.find('input.amount')
		.val();
	var result = 0;
	var am_val = 0;

	var am = $(calculator)
		.find('#check-field1300')
		.is(':checked');
	var checkedPrice = 0;
	var checkedPrice = $('#programmatic_calc .right-calc-block .check-theme input:checked').data('price');

	var resultClicks = 0;
	if (am) {
		am_val = 10000;
	}
	if (checkedPrice) {
		resultClicks = (budget - am_val) / checkedPrice;
	}

	if (resultClicks > 0) {
		resultClicks = number_format(resultClicks, 0, '.', ' ');

		$(calculator)
			.find('.calc-total-result span')
			.html(resultClicks);
	}
}

