$(document).ready(function() {

	$('#cookie-modal-close').on('click', function(e) {
        e.preventDefault();
        BX.setCookie('cookie-modal', 'closed', {expires: 86400, path: '/'});
        $('.cookie-modal').removeClass('active');
    });

	$('#programmatic_calc .check-theme div.jq-checkbox').on('click', function() {
		$('#programmatic_calc .check-theme div.jq-checkbox').removeClass('checked');
		$('#programmatic_calc .check-theme input').prop('checked', false);
		$(this).addClass('checked');
		$(this)
			.find('input')
			.prop('checked', true);
		calculate_programmatic();
	});

	$('#programmatic_calc #check-field1300').change(function() {
		calculate_programmatic();
	});
	$('#programmatic_calc input.amount').change(function() {
		calculate_programmatic();
  });
});

